import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HomeScreen from './pages/home';
import ProductScreen from './pages/products';
import AddProduct from './pages/products/addProducts';
import UsersScreen from './pages/user';
import ProductEditScreen from './pages/products/editProducts';
import Login from './pages/login';

function App() {
  return (
      <Router>
        <Routes>
          <Route exact path='/' element={ <HomeScreen /> } />
          <Route exact path='/products' element={ <ProductScreen /> } />
          <Route exact path='/addProduct' element={ <AddProduct /> } />
          <Route exact path='/users' element={ <UsersScreen /> } />
          <Route exact path='/product/:id/edit' element={ <ProductEditScreen /> } />
          <Route exact path='/login' element={ <Login /> } />
        </Routes>
      </Router>
  );
}

export default App;
